import axios from "axios";
import Grid from "./list";
import { useSelector } from "react-redux/es/hooks/useSelector";
import { useEffect, useState } from "react";
import './Page.css'

function Modal()
{
    const date=new Date()
    const User=useSelector((state)=>state.login)
    const [data,setData]=useState([])
    
    useEffect(()=>{
    axios.post('http://localhost:9000/allpending',{email:User.user,year:date.getFullYear(),month:date.getMonth(),bought:false})
    .then((res)=>{
        setData(res.data)})
    .catch((e)=>{console.log('Error',e)})
    })
    

    return(
        <div>
            <center>
            <table style={{width:'100%'}} border={'1px solid black'}>
                <tbody>
                    <tr>
                        <th>Item</th>
                        <th>Quantity</th>
                        <th>Measure</th>
                    </tr>
                    {data.map((element)=>{return(<tr>
                        <td key='table-cell'><h1>{element.name}</h1></td>
                        <td key='table-cell'>{element.quantity}</td>
                        <td key='table-cell'>{element.type}</td>
                        </tr>)})} 
                </tbody>
            </table>
            </center>
        </div>
    )
}

export default Modal;
